import Grid from '@mui/material/Grid';

function ListTrending() {
  return (
    <div className="listrending">
      <h2>Trending</h2>
      <p>- - - - - - - - - - - - - - - - - - - -  </p>
      <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
        <Grid size={6}>
          <Item>1</Item>
        </Grid>
        <Grid size={6}>
          <Item>2</Item>
        </Grid>       
      </Grid>
    </div>
  );
}

export default ListTrending;
